import React from 'react';
import cupcakesImage from '../../Images/cupcakes.png'; // импорт изображения
import productCard from './productCard.module.css';

function ProductCard(props) {
  return (
    <div>
      {props.data.map((item) => (
        <div key={item.id} className={productCard.container}>
          <div className={productCard.image}>
            {/* Картинка товара */}
            <img src={cupcakesImage} alt={item.titleProduct} />
          </div>
          {/* Далее ваш остальной код компонента */}
        </div>
      ))}
    </div>
  );
}

export default ProductCard;





